tables.table_schema:
CREATE TABLE neural_networks (
    nn_id INT PRIMARY KEY,
    nn_name VARCHAR(50),
    nn_layers INT,
    nn_accuracy FLOAT
);

CREATE TABLE BacktestResults (
  backtest_id INT PRIMARY KEY,
  nn_id INT,
  trade_id INT,
  result DECIMAL(10, 2)
);

CREATE TABLE Strategy (
  strategy_id INT PRIMARY KEY,
  strategy_name VARCHAR(100),
  description TEXT
);

CREATE TABLE HistoricalData (
  data_id INT PRIMARY KEY,
  trade_id INT,
  historical_price DECIMAL(10, 2),
  historical_date DATE
);
